                                <h4 class="panel-title"> <a class="" role="button" data-toggle="collapse" data-parent=".accordion" href="#collapse-curriculum-11" aria-expanded="true" aria-controls="collapse-curriculum-11"> <span class="left">1</span> <span class="right">Foundations of Deep Learning</span> </a> </h4>
                            </div>
                            <div id="collapse-curriculum-11" class="panel-collapse collapse in" role="tabpanel" aria-labelledby="heading-curriculum-11">
                                <div class="panel-body editor-content">
                                    <p><b>Learning Objectives:</b></p>
                                    <p>Learn about the basics on which Deep Learning has been constructed</p>
                                    <p><b>Topics Covered:</b><br></p>
                                    <ul>
                                        <li>Loss function</li>
                                        <li>Cross entropy</li>
                                        <li>K-nearest neighbour algorithm</li>
                                        <li>Minimizing the error - Regression problem</li>
                                    </ul>
                                    <p><b>Hands-on:</b> No hands-on<br></p>
                                </div>
                            </div>
                        </div>
                        <div class="panel panel-default">
                            <div class="panel-heading" role="tab" id="heading-curriculum-12">
                                <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".accordion" href="#collapse-curriculum-12" aria-expanded="false" aria-controls="collapse-curriculum-12"> <span class="left">2</span> <span class="right">Neural Networks Basics</span> </a> </h4>
                            </div>
                            <div id="collapse-curriculum-12" class="panel-collapse collapse" role="tabpanel" aria-labelledby="heading-curriculum-12">
                                <div class="panel-body editor-content">
                                    <p><span style="font-weight:bold;">Learning Objectives:</span></p>
                                    <p>Learn the basics of neural networks and understand the biological inspiration behind the same. Learn to use vectorization to speed up your models. Learn to build a neural network with one hidden layer, using forward propagation and backpropagation. Understand the key computations underlying deep learning, use them to build and train deep neural networks, and apply it to computer vision.Hands-on session on a real-life case study.<span style="font-weight:bold;"></span></p>
                                    <p><b>Topics Covered:<br></b></p>
                                    <ul>
                                        <li>What is Neural Network?</li>
                                        <li>The Biological Inspiration</li>
                                        <li>Multilayer Perceptrons</li>
                                        <li>Gradient Descent</li>
                                        <li>Vectorization</li>
                                        <li>Shallow Neural Networks</li>
                                        <li>Activation Functions</li>
                                        <li>Back Propagation Algorithm</li>
                                        <li>Deep L-layer neural network</li>
                                        <li>Forward Propagation in a Deep Network</li>
                                        <li>Case Study: Neural Networks</li>
                                    </ul>
                                    <p><b>Hands-on:</b> </p>
                                    <p>The dataset lends itself to a some very interesting visualizations. One can look at simple things like how prices change over time, graph and compare multiple stocks at once, or generate and graph new metrics from the data provided. From these data informative stock stats such as volatility and moving averages can be easily calculated. Can you develop a model that can beat the market and allow you to make statistically informed trades? Using Base Neural Network and Neural Network with Hidden layers, Activation function, Solver and Learning Rate , predict close value of stock.</p>
                                </div>
                            </div>
                        </div>
                        <div class="panel panel-default">
                            <div class="panel-heading" role="tab" id="heading-curriculum-13">
                                <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".accordion" href="#collapse-curriculum-13" aria-expanded="false" aria-controls="collapse-curriculum-13"> <span class="left">3</span> <span class="right">Introduction to Deep Learning</span> </a> </h4>
                            </div>
                            <div id="collapse-curriculum-13" class="panel-collapse collapse" role="tabpanel" aria-labelledby="heading-curriculum-13">
                                <div class="panel-body editor-content">
                                    <p><b>Learning Objectives:</b>&nbsp;</p>
                                    <p>Understand industry best-practices for building deep learning applications. Learn to effectively use the common neural network "tricks", including initialization, L2 and dropout regularization, Batch normalization, gradient checking. Be able to implement and apply a variety of optimization algorithms, such as mini-batch gradient descent, Momentum, RMSprop and Adam, and check for their convergence.Learn Keras for Classification and Regression in Typical Data Science Problems. Learn about&nbsp; different layers in KERAS and set it up. Hands-on session on a real-life case study.<br><b><br></b><b>Topics Covered:</b></p>
                                    <ul>
                                        <li>Hyperparameters tuning</li>
                                        <li>Batch Normalization</li>
                                        <li>Optimization algorithms</li>
                                        <li>Deep Learning frameworks</li>
                                        <li>Weight initialization</li>
                                        <li>Deep Learning architecture</li>
                                        <li>Introducing Keras</li>
                                        <li>Artificial Neural Networks (ANN)</li>
                                        <li>Case Study: Artificial Neural Networks (ANN)</li>
                                    </ul>
                                    <p><b>Hands-on:</b> </p>
                                    <p>Apply Deep Learning framework - Keras to create a Neural Network, train models and monitor the same.Project research will be aimed at the case of customers’ default payments in Taiwan. From the perspective of risk management, the result of predictive accuracy of the estimated probability of default is proven to be more valuable than the binary result of classification - credible or not credible clients.<br></p>
                                </div>
                            </div>
                        </div>
                        <div class="panel panel-default">
                            <div class="panel-heading" role="tab" id="heading-curriculum-14">
                                <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".accordion" href="#collapse-curriculum-14" aria-expanded="false" aria-controls="collapse-curriculum-14"> <span class="left">4</span> <span class="right">Computer Vision</span> </a> </h4>
                            </div>
                            <div id="collapse-curriculum-14" class="panel-collapse collapse" role="tabpanel" aria-labelledby="heading-curriculum-14">
                                <div class="panel-body editor-content">
                                    <p><span style="font-weight:bold;">Learning Objectives:</span></p>
                                    <p>Learn to implement the foundational layers of CNNs (pooling, convolutions) and to stack them properly in a deep network to solve multi-class image classification problems.<br><b><br></b><b>Topics Covered:</b></p>
                                    <ul>
                                        <li>Convolutional Neural Networks (CNN)</li>
                                        <li>Building blocks of CNN</li>
                                        <li>Image Processing using CNN</li>
                                        <li>Pre processing and semantic segmentation</li>
                                        <li>Object localization and detection</li>
                                        <li>Introducing Tensorflow</li>
                                        <li>Case Study: Convolutional Neural Networks (CNN) using TensorFlow</li>
                                    </ul>
                                    <p><b>Hands-on:</b>&nbsp; No Hands-on<br></p>
                                </div>
                            </div>
                        </div>
                        <div class="panel panel-default">
                            <div class="panel-heading" role="tab" id="heading-curriculum-15">
                                <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".accordion" href="#collapse-curriculum-15" aria-expanded="false" aria-controls="collapse-curriculum-15"> <span class="left">5</span> <span class="right">Object Detection</span> </a> </h4>
                            </div>
                            <div id="collapse-curriculum-15" class="panel-collapse collapse" role="tabpanel" aria-labelledby="heading-curriculum-15">
                                <div class="panel-body editor-content">
                                    <p><span style=""><b>Learning Objectives:</b></span></p>
                                    <p>Learn how to apply your knowledge of CNNs to one of the toughest but hottest field of computer vision: Object detection.<br><b><br></b><b>Topics Covered:</b></p>
                                    <ul>
                                        <li>Object localization</li>
                                        <li>Object detection&nbsp;</li>
                                        <li>Feature Extraction </li>
                                    </ul>
                                    <p><b>Hands-on:</b>&nbsp; No Hands-on<br></p>
                                </div>
                            </div>
                        </div>
                        <div class="panel panel-default">
                            <div class="panel-heading" role="tab" id="heading-curriculum-16">
                                <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".accordion" href="#collapse-curriculum-16" aria-expanded="false" aria-controls="collapse-curriculum-16"> <span class="left">6</span> <span class="right">TensorFlow</span> </a> </h4>
                            </div>
                            <div id="collapse-curriculum-16" class="panel-collapse collapse" role="tabpanel" aria-labelledby="heading-curriculum-16">
                                <div class="panel-body editor-content">
                                    <p><b>Learning Objectives:</b> </p>
                                    <p>Get introduced to TensorFlow, a library. Learn to build a Neural Networks using Tensorflow. Hands-on session on a real-life case study<br><b><br></b><b>Topics Covered:</b></p>
                                    <ul>
                                        <li>Introducing Tensorflow<br></li>
                                        <li>Case Study: Convolutional Neural Networks (CNN) using TensorFlow</li>
                                    </ul>
                                    <p><b>Hands-on:</b> </p>
                                    <p>Apply Deep Learning framework - TensorFlow to create a Neural Network and train models and monitor the same. Work on a project involving handwriting digit recognition using CNN with TensorFlow. This project will help build a model using Convolutional Neural Networks to recognize handwriting.<br></p>
                                </div>
                            </div>
                        </div>
                        <div class="panel panel-default">
                            <div class="panel-heading" role="tab" id="heading-curriculum-17">
                                <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".accordion" href="#collapse-curriculum-17" aria-expanded="false" aria-controls="collapse-curriculum-17"> <span class="left">7</span> <span class="right">Sequence Models</span> </a> </h4>
                            </div>
                            <div id="collapse-curriculum-17" class="panel-collapse collapse" role="tabpanel" aria-labelledby="heading-curriculum-17">
                                <div class="panel-body editor-content">
                                    <p><b>Learning Objectives:</b></p>
                                    <p>Learn about recurrent neural networks. This type of model has been proven to perform extremely well on temporal data. It has several variants including LSTMs, GRUs and Bidirectional RNNs, which you are going to learn about in this section. Hands-on session on a real-life case study.<br><b><br></b><b>Topics Covered:</b></p>
                                    <ul>
                                        <li>Recurrent Neural Networks (RNN)</li>
                                        <li>Backpropagation through time</li>
                                        <li>Different types of RNNs</li>
                                        <li>Language model and sequence generation</li>
                                        <li>Gated Recurrent Unit (GRU)</li>
                                        <li>Long Short Term Memory (LSTM)</li>
                                        <li>Bidirectional RNN</li>
                                        <li>Deep RNNs</li>
                                        <li>Case Study: Recurrent Neural Networks (RNN)</li>
                                    </ul>
                                    <p><span style=""><b>Hands-on:</b></span></p>
                                    <p><span style=""></span>A time series is a sequence taken at successive equally spaced points in time. Thus it is a sequence of discrete-time data. Using Long-Short Term-Memory (LSTM) build a time series model to forecast the future values<br></p>
                                </div>
                            </div>
                        </div>
                        <div class="panel panel-default">
                            <div class="panel-heading" role="tab" id="heading-curriculum-18">
                                <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".accordion" href="#collapse-curriculum-18" aria-expanded="false" aria-controls="collapse-curriculum-18"> <span class="left">8</span> <span class="right">Natural Language Processing (NLP)</span> </a> </h4>
                            </div>
                            <div id="collapse-curriculum-18" class="panel-collapse collapse" role="tabpanel" aria-labelledby="heading-curriculum-18">
                                <div class="panel-body editor-content">
                                    <p><b>Learning Objectives:</b> </p>
                                    <p>Learn to use word vector representations and embed layers to train recurrent neural networks with outstanding performances in a wide variety of industries. Examples of applications are sentiment analysis, named entity recognition and machine translation. Hands-on session on a real life case study.<br><b><br></b><b>Topics Covered:</b></p>
                                    <ul>
                                        <li>Syntax and Parsing Techniques</li>
                                        <li>Statistical NLP and text similarities</li>
                                        <li>Text summarization techniques</li>
                                        <li>Real-Life Case Study</li>
                                    </ul>
                                    <p><b>Hands-on:</b> </p>
                                    <p>Stock market prediction has been an interesting research topic for many years. Finding an efficient and effective means of studying the market perceptions found its way in different social networking platforms such as Twitter. With proper tools and the help of technology, meaningful and precious information can be gathered, analyzed, and utilized in different areas like in the movement and performance of the stock market.<br></p>
                                </div>
                            </div>
                        </div>
                    </div>
