                                        <p>This trend has made deep learning enthusiasts among the most sought after professionals and this is a good workshop for you to master these skills and become proficient in deep learning concepts. The 5th-annual Burtch Works Study: Salaries of Data Scientists puts median compensations for individual contributors in a range of $95,000 at level 1 (0-3 years of experience) to $165,000 at level 3 (9+ years). Managers can earn $145,000 at level 1 (1-3 reports) to $250,000 at level 3 (10+ reports). So, this is the right time to invest in a career in Deep Learning.</p>
