                    <h3 id="">Finance Related</h3>
                    <div class="panel-group faq-accordion-2" role="tablist" aria-multiselectable="true">
                        <div class="panel panel-default">
                            <div class="panel-heading" role="tab" id="faq-heading-2-1">
                                <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".faq-accordion-2" href="#faq-2-1" aria-expanded="false" aria-controls="faq-2-1">If I cancel the enrolment, will I get a refund?</a> </h4>
                            </div>
                            <div id="faq-2-1" class="panel-collapse collapse" role="tabpanel" aria-labelledby="faq-heading-2-1">
                                <div class="panel-body">
                                    <div class="editor-content">
                                        <p>Any registration canceled within 48 hours of the initial registration will be refunded in FULL (please note that all cancellations will incur a 5% deduction in the refunded amount due to transactional costs applicable while refunding) Refunds will be processed within 30 days of receipt of a written request for refund. Kindly go through our&nbsp;<a href="#" target="_blank" rel="nofollow" style="background-color:#fff;">Refund Policy</a>&nbsp;for more details.<br></p>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div class="panel panel-default">
                            <div class="panel-heading" role="tab" id="faq-heading-2-2">
                                <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".faq-accordion-2" href="#faq-2-2" aria-expanded="false" aria-controls="faq-2-2">What is your 100% Money Back Guarantee?</a> </h4>
                            </div>
                            <div id="faq-2-2" class="panel-collapse collapse" role="tabpanel" aria-labelledby="faq-heading-2-2">
                                <div class="panel-body">
                                    <div class="editor-content">
                                        <p>KnowledgeHut offers a 100% money-back guarantee if the candidate withdraws from the course right after the first session. To learn more about the 100% refund policy, visit our&nbsp;<a href="#" target="_blank" rel="nofollow" style="background-color:#fff;">Refund Policy</a>.</p>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                    <h3 id="">The Remote Experience</h3>
                    <div class="panel-group faq-accordion-3" role="tablist" aria-multiselectable="true">
                        <div class="panel panel-default">
                            <div class="panel-heading" role="tab" id="faq-heading-3-1">
                                <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".faq-accordion-3" href="#faq-3-1" aria-expanded="false" aria-controls="faq-3-1">What will the online classroom experience be like?</a> </h4>
                            </div>
                            <div id="faq-3-1" class="panel-collapse collapse" role="tabpanel" aria-labelledby="faq-heading-3-1">
                                <div class="panel-body">
                                    <div class="editor-content">
                                        <p>In an online classroom, students can log in at the scheduled time to a live learning environment which is led by an instructor. You can interact, communicate, view and discuss presentations, and engage with learning resources while working in groups, all in an online setting. Our instructors use an extensive set of collaboration tools and techniques which improves your online training experience.</p>
